import React from 'react'
import '../css/Style.css';
import NavBar from './rfc/NavBar';


export default class Commande extends React.Component {

    constructor(props) {
        super();
        const { id } = this.props.match.params.id;
    }

    render() {
        return (
            <div>
                <header>
                    <NavBar />
                </header>
                <div className="content">
                    <h1>{id}</h1>
                </div>
            </div>
        )
    }
}
